import React from 'react';
import house from "./House.png";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={house} className="App-logo" alt="logo" />
        <p>
          Spacious 4 bedroom property available July-August 2021.
        </p>
      </header>
    </div>
  );
}

export default App;
